    render() {
        return (
            <div>
            <section className='cabeçalho'>
            <Header />
            <Link to='/'>
            <button>Home</button>
            </Link>
            </section>
            <div>
                <p>Open to work</p>
            </div>             
            </div>
        )
    }
}

export default SoftwareDev;
